/** @format */

import React from "react";
import { TitleBlock, Thumbnail, TitleBox } from "./StyleTitleCard";
const TitleCard = () => {
  return (
    <>
      <TitleBlock>
        <Thumbnail />
        <TitleBox>
          <h2>닭치Go</h2>
        </TitleBox>
      </TitleBlock>
    </>
  );
};

export default TitleCard;
